--
-- Table structure for table `city`
--

DROP TABLE IF EXISTS `city`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `city` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `city_global_id` varchar(50) DEFAULT NULL COMMENT '城市系统id',
  `shop_city_id` bigint(20) DEFAULT NULL COMMENT '城市系统id',
  `city_code` int(11) DEFAULT NULL COMMENT '城市通用编码,切换天气数据源时使用',
  `country_code` varchar(20) DEFAULT NULL COMMENT '国家code',
  `city_name` varchar(50) DEFAULT NULL COMMENT '城市名称',
  `city_name_en` varchar(50) DEFAULT NULL COMMENT '城市英文名',
  `country` varchar(30) DEFAULT NULL COMMENT '国家',
  `ownership1` varchar(60) DEFAULT NULL COMMENT '所属地区1',
  `ownership1_en` varchar(60) DEFAULT NULL COMMENT '所属地区1英文',
  `ownership2` varchar(60) DEFAULT NULL COMMENT '所属地区2',
  `ownership2_en` varchar(60) DEFAULT NULL COMMENT '所属地区2英文',
  `time_zone` varchar(30) DEFAULT NULL COMMENT '时区',
  `city_level` varchar(20) DEFAULT NULL COMMENT '城市级别',
